import AppBar from "./components/AppBar";
import {BrowserRouter, Navigate, Route, Routes} from "react-router-dom";
import Home from "./pages/Home";
import Slider from "./components/Slider";


function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <AppBar/>
            <Routes>
                <Route path={'/'} element = {<Slider/>}/>
            </Routes>
        </BrowserRouter>

    </div>
  );
}

export default App;
